    def swap(lst1,lst2,i,j):
        s1,s2 = lst1,lst2
        s1[i],s1[j] = s1[j],s1[i]
        s2[i],s2[j] = s2[j],s2[i]
        return s1,s2

    def move(lst1,lst2):
        if lst2[-1][0] == lst1[-1][0]:
            swap(lst1,lst2,0,len(lst2)-1)
            lst1.pop()
            lst2.pop()
        else:
            s1 = merge(lst1,lst2)
            s2 = swap(lst1,lst2,0,len(lst2)-1)
            lst1,lst2 = s1,s2

    def tsort(lst):
        s = []
        for i in range(n):
            s.append(list(map(int,str(lst[i][0]))))
            s.append(list(map(int,str(lst[i][1]))))
        return s

    for i in range(n):
        for j in range(i+1,n):
            if tsort([lst[i],lst[j]]) not in lst:
                move(lst[i],lst[j])
                lst = swap(lst,tort(lst),i,j)
                if len(lst) >= m:
