class Solution:
    def diameterOfBinaryTree(self, root: TreeNode) -> int:
        self.res = 0
        def helper(root, d=0):
            if not root:
                return 0
            if not root.left and not root.right:
                self.res = max(self.res, d + 1)
                return d + 1
            d1, d2 = helper(root.left, d + 1), helper(root.right, d + 1)
            self.res = max(self.res, d + 1 + d1 + d2)
            return max(d1, d2) + 1
        helper(root)
        return self.res - 1

