    def is_valid(i, j, match):
        return i < W and 0 <= i + j < len(match) and match[i + j] == match[i]
    def get_match(i, j, match):
        return match[i + j]

    answer = ''
    for i in range(W):
        for j in range(H):
            if not is_valid(i, j, matches[i]):
                break
            match = matches[i]
            for match_i, match_j in zip(range(W), range(H)):
                if match[match_i] == get_match(i, match_j, match):
                    match = match[:match_j] + get_match(match_i, match_j, match) + match[match_j + 1:]
                    answer += get_match(i, match_j, match)
                    break
    return answer

